-- Table structure for `corp_comprehensive_eval`
-- ----------------------------
DROP TABLE IF EXISTS `corp_comprehensive_eval`;
CREATE TABLE `corp_comprehensive_eval` (
  `rec_uid` varchar(32) NOT NULL COMMENT '记录Id,主键',
  `corp_id` varchar(32) DEFAULT NULL COMMENT '企业Id',
  `oper_year` char(4) DEFAULT NULL COMMENT '时间(年)',
  `current_rate` decimal(10,2) DEFAULT NULL COMMENT '流动比率',
  `quick_rate` decimal(10,2) DEFAULT NULL COMMENT '速动比率',
  `interest_coverage` decimal(10,2) DEFAULT NULL COMMENT '利息保障倍数',
  `cash_rate` decimal(10,2) DEFAULT NULL COMMENT '现金比率',
  `assets_and_liabilities` decimal(10,2) DEFAULT NULL COMMENT '资产负债率',
  `equity_rate` decimal(10,2) DEFAULT NULL COMMENT '产权比例',
  `receivable_turnover_rate` decimal(11,0) DEFAULT NULL COMMENT '应收账款周转率（次/年）',
  `receivable_turnover_rate_days` decimal(11,0) DEFAULT NULL COMMENT '应收账款周转天数（天/次）',
  `inventory_turnover` decimal(11,0) DEFAULT NULL COMMENT '存货周转率（次/年）',
  `inventory_turnover_days` decimal(11,0) DEFAULT NULL COMMENT '存货周转期（天/次）',
  `current_assets_turnover` decimal(11,0) DEFAULT NULL COMMENT '流动资产周转率（次/年）',
  `current_assets_turnover_days` decimal(11,0) DEFAULT NULL COMMENT ' 流动资产周转期（天/次）',
  `fixed_asset_turnover` decimal(11,0) DEFAULT NULL COMMENT ' 固定资产周转率（次/年）',
  `fixed_asset_turnover_days` decimal(11,0) DEFAULT NULL COMMENT ' 固定资产周转期（天/次）',
  `total_asset_turnover` decimal(11,0) DEFAULT NULL COMMENT '总资产周转率（次/年）',
  `total_asset_turnover_days` decimal(11,0) DEFAULT NULL COMMENT '总资产周转期',
  `accounts_payable_turnover` decimal(11,0) DEFAULT NULL COMMENT '应付账款周转率（次/年）',
  `accounts_payable_turnover_days` decimal(11,0) DEFAULT NULL COMMENT '应付账款周转天数（天/次）',
  `cash_turnover` decimal(11,0) DEFAULT NULL COMMENT '现金周转率（次/年）',
  `cash_turnover_days` decimal(11,0) DEFAULT NULL COMMENT '现金周转天数（天/次）',
  `operating_margin` decimal(10,2) DEFAULT NULL COMMENT '营业利润率',
  `operating_net_profit` decimal(10,2) DEFAULT NULL COMMENT '营业净利率',
  `operating_gross_profit` decimal(10,2) DEFAULT NULL COMMENT ' 营业毛利率',
  `cost_margins` decimal(10,2) DEFAULT NULL COMMENT '成本费用利润率',
  `cost_rate` decimal(10,2) DEFAULT NULL COMMENT '成本费用率',
  `return_total_assets` decimal(10,2) DEFAULT NULL COMMENT '总资产报酬率',
  `return_net_assets` decimal(10,2) DEFAULT NULL COMMENT '净资产收益率',
  `main_business_revenue_growth` decimal(10,2) DEFAULT NULL COMMENT '主营业务收入增长率',
  `main_business_profit_growth` decimal(10,2) DEFAULT NULL COMMENT '主营业务利润增长率',
  `net_profit_growth` decimal(10,2) DEFAULT NULL COMMENT '净利润增长率',
  `total_asset_growth` decimal(10,2) DEFAULT NULL COMMENT '总资产增长率',
  `capital_maintenance_and_appreciation` decimal(10,2) DEFAULT NULL COMMENT '资本保值增值率',
  `cash_of_sales` decimal(10,2) DEFAULT NULL COMMENT '销售收现比率',
  `cash_of_purchase` decimal(10,2) DEFAULT NULL COMMENT '购货付现比率',
  `net_operating_cash_to_sales` decimal(10,2) DEFAULT NULL COMMENT '经营现金净流量对销售收入比率',
  `operating_cash_rate_of_return` decimal(10,2) DEFAULT NULL COMMENT '资产的经营现金流量回报率',
  `net_operating_cash_to_profit` decimal(10,2) DEFAULT NULL COMMENT '经营现金净流量对净利润的比率',
  `net_operating_cash_to_debt` decimal(10,2) DEFAULT NULL COMMENT '经营现金净流量对负债比率',
  `proportion_of_fixed_assets` decimal(10,2) DEFAULT NULL COMMENT '固定资产比重',
  `shareholder_rate` decimal(10,2) DEFAULT NULL COMMENT '股东权益比率',
  `fixed_assets_and_equity_rate` decimal(10,2) DEFAULT NULL COMMENT '股东权益与固定资产比率',
  `main_business_profit_rate` decimal(10,2) DEFAULT NULL COMMENT '主营业务利润比重',
  `accounts_receivable_income_rate` decimal(10,2) DEFAULT NULL COMMENT '应收账款占收入比重',
  `liquidity_income_rate` decimal(10,2) DEFAULT NULL COMMENT '流动资金创收率',
  `total_assets_profit_margin` decimal(10,2) DEFAULT NULL COMMENT '总资产利润率',
  `loan_recovery_during_reporting_period` decimal(10,2) DEFAULT NULL COMMENT '报告期内货款回收率',
  `rela_corp_id` varchar(32) DEFAULT NULL COMMENT '所属保理商企业Id',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `create_user_id` varchar(32) DEFAULT NULL COMMENT '创建者Id',
  `longterm_debt_rate` decimal(10,2) DEFAULT NULL COMMENT '长期负债比率',
  PRIMARY KEY (`rec_uid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='企业综合评价';

